const BlogList = (blogs,title) => {
    return ( 
        <div className="blog-list"> 
            <h1>{title}</h1>
            {blogs.map((blog) => (         
            <div className="blogPreview" key={blog.id}>
            <h2>{blog.title}</h2>
            <p>written by <strong>{blog.author}</strong></p>  
            </div>               
        ))}
        </div>
     );
}

export default BlogList;
